  input: 'TEXT,F3XA,,"1. Even though payments were made after the primary date, the
    value of the in-kind contributions was realized by the campaign on or before the
    date of the primary. The Committee has amended its report to add memo entries
    to show the dates that the campaign received the in-kind contribution. 2. Names
    in the News is a national list vending firm that facilitates the sale of The Committee''s
    list to other organizations. Having checked with Names in the News, we have been
    assured that the payment to The Committee is the ''usual and normal'' charge.
    3 The Committee uses the following procedures to meet its ''best efforts'' obligations:
    Any solicitation for contributions made by The Committee includes a clear and
    conspicuous request for contributor information. If that information is not provided,
    The Committee makes a follow up request by written instrument within 30 days of
    receipt of the contribution. 4. The Committee adopted a new Funds Expended ratio
    of 10% federal and 90% non-federal for administrative expenses to conform more
    closely to its anticipated activity. The Committee''s Post-Election report will
    disclose $33,017.18 Federal and 303096.52 non-federal, thus meeting The Committee''s
    new allocation ratio.5. Please find The Committees amended Schedule H2 disclosing
    relevant ratios. 6. The Committee will amend its report to disclose all relevant
    memo entries."'
